import React from "react";
import { Header } from "./Componentes/Header";
import { ProductosLista } from "./Componentes/Productos";
import "boxicons";
import { BrowserRouter as Router } from "react-router-dom";
import { Paginas } from "./Componentes/paginas";

function App() {
  return (
    <div className="App">
      <Header />
      <Router></Router>
      <ProductosLista />
    </div>
  );
}

export default App;
